import './App.css';
import Home from './pages/Home'
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Buy from './pages/Buy'
function App() {
  return (

    <Router>
     <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Buy" element={<Buy />} />

      </Routes>
    </Router>
  );
}

export default App;
